#include <gtk/gtk.h>
#include <stdlib.h>

#define TOTAL_EMOJIS 250 //4168 = total
#define INT_WINDOW_WIDTH 600
#define INT_WINDOW_HEIGHT 600

struct Emoji
{
    char emoji_code[36];
    char description[255];
    int times_clicked;
};

typedef struct data_clicked
{
  GtkWidget     *scrolled_window;
  GtkWidget     *window;
  GtkWidget     *grid;
  GtkClipboard  *clipboard;
  struct Emoji  *structured_emojis;
  int            index_emoji;
} data_clicked;

static void
action_on_emoji_click (GtkWidget *widget,
                       data_clicked *data);

static void
filter_results (GtkSearchEntry *entry,
                GtkLabel       *result_label)
{
  const char *textToFilter;

  textToFilter = gtk_entry_get_text (GTK_ENTRY (entry));
  g_message ("Filtering by: %s", textToFilter);
  gtk_label_set_text (result_label,
                      strcmp (textToFilter, "") 
                      != 0 
                        ? textToFilter 
                        : "Digite para filtrar / Start Typing to filter");
}

static int
comparison_by_times_clicked (const void *e1, 
                             const void *e2)
{
  const struct Emoji *emoji1 = e1;
  const struct Emoji *emoji2 = e2;

  return emoji1->times_clicked == emoji2->times_clicked ? 
         0 : (emoji1->times_clicked < emoji2->times_clicked ? 1 :  -1);
}

static void
position_new_button_in_grid (int          index, 
                             struct Emoji *structured_emojis, 
                             GtkWidget    *grid, 
                             GtkWidget    *scrolled_window,
                             GtkWidget    *window,
                             GtkClipboard *clipboard)
{
  data_clicked  *data_args = malloc(sizeof(struct Emoji));
  GtkWidget    *button_emoji;

  data_args->scrolled_window   = scrolled_window;
  data_args->grid              = grid;
  data_args->clipboard         = clipboard;
  data_args->structured_emojis = structured_emojis;
  data_args->index_emoji       = index;
  data_args->window            = window;

  button_emoji = gtk_button_new_with_label (structured_emojis[index].emoji_code);
  g_signal_connect (button_emoji, 
                    "clicked", 
                    G_CALLBACK (action_on_emoji_click), data_args);
  gtk_grid_attach (GTK_GRID (grid), button_emoji, index % 10, index / 10 + 2, 1, 1);
}

static void
copy_emoji_to_clipboard (char         emoji[36],
                         GtkClipboard *clipboard)
{
  gtk_clipboard_set_text (clipboard, emoji, 36);
}

static void
sort_struct_emoji_array (struct Emoji *e)
{
  qsort (e, TOTAL_EMOJIS, sizeof(struct Emoji), comparison_by_times_clicked);
}

static void
increase_clicked_counter_for_emoji(data_clicked *data)
{
  data->structured_emojis[data->index_emoji].times_clicked++;
  g_message ("Emoji:: %s TimesClicked: %d", data->structured_emojis[data->index_emoji].emoji_code, data->structured_emojis[data->index_emoji].times_clicked);
}

static void
draw_interface_grid (GtkWidget    *window,
                     GtkWidget    *grid, 
                     GtkWidget    *scrolled_window, 
                     struct Emoji *structured_emojis,
                     GtkClipboard *clipboard)
{ 
  GtkWidget  *filter_entry; //filter_entry should be GtkSearchEntry but gcc
  GtkWidget  *label;        //gives us a warning If we declare it like this. Why?

  if (GTK_CONTAINER (grid)) {
    gtk_container_remove (GTK_CONTAINER (scrolled_window), grid);
    gtk_container_remove (GTK_CONTAINER (window), scrolled_window);
  }

  grid = gtk_grid_new ();
  scrolled_window = gtk_scrolled_window_new (NULL, NULL);

  gtk_container_set_border_width (GTK_CONTAINER (scrolled_window), 10);
  gtk_scrolled_window_set_policy (GTK_SCROLLED_WINDOW (scrolled_window),
                                  GTK_POLICY_AUTOMATIC,
                                  GTK_POLICY_AUTOMATIC);

  gtk_container_add (GTK_CONTAINER (window), scrolled_window);

  gtk_container_add (GTK_CONTAINER (scrolled_window), grid);

  for (int each_index = 0; 
       each_index < TOTAL_EMOJIS ;
       each_index++)
      position_new_button_in_grid (each_index, 
                                   structured_emojis, 
                                   grid, 
                                   scrolled_window, 
                                   window,
                                   clipboard);

  filter_entry = gtk_search_entry_new ();
  label = gtk_label_new ("Digite para filtrar / Start Typing to filter");
  gtk_grid_attach (GTK_GRID (grid), GTK_WIDGET(filter_entry), 0, 0, 11, 1);
  gtk_grid_attach (GTK_GRID (grid), GTK_WIDGET(label), 0, 1, 11, 1);
  g_signal_connect (filter_entry, "search_changed",
                    G_CALLBACK (filter_results), label);
  gtk_widget_show_all (window);
}

static void
action_on_emoji_click (GtkWidget    *widget,
                       data_clicked *data)
{  
  copy_emoji_to_clipboard (data->structured_emojis[data->index_emoji].emoji_code,
                           data->clipboard);
  increase_clicked_counter_for_emoji(data);
  sort_struct_emoji_array (data->structured_emojis);
  draw_interface_grid (data->window,
                       data->grid, 
                       data->scrolled_window, 
                       data->structured_emojis, 
                       data->clipboard);
}

static void
setup_interface (GtkApplication  *app,
                 struct Emoji    *populated_emojis_struct)
{
  GtkWidget      *window;
  GtkWidget      *scrolled_window;
  GtkClipboard   *clipboard;
  GtkWidget      *grid_emojis;

  window = gtk_application_window_new (app);
  g_signal_connect (window, "destroy", G_CALLBACK (gtk_main_quit), NULL);

  clipboard = gtk_clipboard_get (GDK_SELECTION_CLIPBOARD);
  
  gtk_window_set_title (GTK_WINDOW (window), "Emoji Selector");
  gtk_window_set_default_size (GTK_WINDOW (window), INT_WINDOW_WIDTH, INT_WINDOW_HEIGHT);
  
  gtk_container_set_border_width (GTK_CONTAINER (window), 5);

  draw_interface_grid (window,
                       grid_emojis, 
                       scrolled_window, 
                       populated_emojis_struct, 
                       clipboard);

  gtk_main();
}

